INSERT INTO `tareas` VALUES (30,'MOTORES 3D','<p>Los \"mejores\" motores son extremadamente caros, con Blender puedes aprender lo b&aacute;sico y si ves que te gusta el tema siempre puedes adaptarte m&aacute;s adelante a los estandares de la industria. Ten presente que para la creaci&oacute;n de los videojuegos participan equipos de gente especializada en cada rama, tendr&aacute;s que ir probando cada una para ver donde te desenvuelves mejor seg&uacute;n tus gustos y habilidades.</p>','2013-08-06','IEEQWvI7Tc',30,'diego.ramirez'),(31,'Histograma','<p style=\"text-align: justify;\"><strong><em>El histograma es un tipo especial de gr&aacute;fico de barras que se puede utilizar para comunicar&nbsp;</em></strong></p>\r\n<p style=\"text-align: justify;\"><strong><em>informaci&oacute;n sobre las variaciones de un proceso y/o tomar decisiones enfoc&aacute;ndose en los&nbsp;</em></strong></p>\r\n<p style=\"text-align: justify;\"><strong><em>esfuerzos de mejora que se han realizado.</em></strong></p>','2013-08-06','L22fvbH4j3',29,'alejandro.rodriguez'),(32,'Objeto','<p class=\"MsoNormal\">Un objeto es un componente de programa que posee instancia, es decir espacio de memoria para sus propiedades y funciones. Este siempre es resultado de una clase y debe ser \"creado\" de otra forma.</p>','2013-08-06','2af0pMWv7S',28,'david.chindo'),(33,'OBJETO','<p>La programaci&oacute;n orientada a objetos consiste en ordenar datos en conjuntos modulares de elementos de informaci&oacute;n del mundo real (denominado un dominio). Estos elementos de datos se llaman objetos. Estos datos se agrupan de acuerdo a las caracter&iacute;sticas principales del mundo real de estos elementos (tama&ntilde;o, color, etc.).&gt;</p>','2013-08-06','2af0pMWv7S',28,'diego.ramirez'),(34,'MATRICES','<p>SE REALIZO LA MATRIZ</p>','2013-08-06','3B3qb2kfC',33,'antonio.gonzalez'),(35,'CONJUNTOS','<p>SE REALIZO LA TAREA DE CONJUNTOS</p>','2013-08-06','3B3qb2kfC',32,'antonio.gonzalez'),(29,'Histograma','<p class=\"MsoNormal\">Un histograma es una representaci&oacute;n gr&aacute;fica de una variable en forma de barras, donde la superficie de cada barra es proporcional a la frecuencia de los valores representados. En el eje vertical se representan las frecuencias, y en el eje horizontal los valores de las variables, normalmente se&ntilde;alando las marcas de clase, es decir, la mitad del intervalo en el que est&aacute;n agrupados los datos</p>','2013-08-06','L22fvbH4j3',29,'david.chindo');
/*!40000 ALTER TABLE `tareas` ENABLE KEYS */;
